import React from 'react';
import './App.css';
import Header from './components/header';
import 'bootstrap/dist/css/bootstrap.css';
import Moviesection from './components/moviesection';
import { BrowserRouter, Routes } from 'react-router-dom';

function App() {
  return (
    <div className="App">
      <BrowserRouter>
      <Routes>
       <Header/>
       <Moviesection/>
       </Routes>
       </BrowserRouter>
    </div>
  );
}

export default App;
